('2377','2','8347','Wohnung Fehr',Null,'Traumhafte Wohnung in Wohnresidenz mit botanischem Garten und spektakulärem Schwimmbad in Santa Ponsa','33445','Die Wohnresidenz mit ihren mediterranen Luxuswohnungen gehört aufgrund der tropischen Bepflanzung, der wunderschönen Poollandschaft mit  Sonnenterrassen, Grünflächen und außergewöhnlichem Poolhaus mit Kamin und Barbereich für gemütliche Stunden zu den schönsten im Südwesten. Eine Tiefgarage, verschiedene Stellplätze für Autos, Aufzüge und Sicherheitsdienst gehören zur Residenz, welche sich in unmittelbarer Nähe zur Küste und Golfplätzen befindet. Die hochwertig ausgestattete Wohnung mit einer Wohnfläche von 113 m² plus 33 m² Terrassenfläche verfügt über Wohn- Esszimmerbereich mit amerikanischer Küche, Hauswirtschaftsraum und 2 Schlafzimmern mit jeweils Bad en suite.\r\nHochwertige Ausstattung: Marmorfußböden, umschaltbare Klimaanlage, Sat.-Empfang, hochwertige Fenster mit Blendläden, Videoüberwachung\r\n','33446','350000','106','2015-09-14 09:59:54','106','2015-09-14 10:00:41',Null,'2470','121','1158',1,'1','0',Null,Null,Null,'33447',Null,'0','0','0',Null,'2015-09-14 10:05:54',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33448',Null,'33449',Null,'33450',Null,'33451','sasha 649666493   vogelsang 618387811','33452','0',0,'5');
